  cache: new InMemoryCache(),
  //uri: "https://48p1r2roz4.sse.codesandbox.io",
  uri: "https://countries.trevorblades.com"
});

const App = () => (
  <ApolloProvider client={client}>
    <Home/>
  </ApolloProvider>
);

export default App;
